import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import {
  About,
  Blogs,
  PreviewBlog,
  Contact,
  Home,
  Login,
  Navbar,
  Footer,
} from "../../components/index";
import axios from "axios";

const Routers = () => {
  const [dataCategories, setDataCategories] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:3006/categories")
      .then((res) => {
        setDataCategories(res.data.data);  
      })
      .catch((err) => console.log(err));
  }, []);
  return (
    <>
      <Navbar />
      <Router>
        <Routes>
          <Route exact path="/" element={<Home Navbar={<Navbar />} Footer={<Footer  />} />} />
          <Route exact path="/about" element={<About />} />
          <Route exact path="/contact" element={<Contact />} />
          <Route exact path="/blog" element={<Blogs />} />
          <Route exact path="/previewBlog" element={<PreviewBlog />} />
          <Route exact path="/login" element={<Login />} />
        </Routes>
      </Router>
      <Footer Categories={dataCategories} />
    </>
  );
};

export default Routers;
